import React from 'react'
import { List } from 'antd';
import {MailOutlined} from '@ant-design/icons'
import styled from 'styled-components'

const MetaWrapper = styled.div`

    margin:2rem 0;

`;

const Meta = ({userMeta}) => {
    return (
        <MetaWrapper>
        <List header={<h3>User Meta</h3>} itemLayout="horizontal">
             <List.Item>
                <List.Item.Meta
                title={<> <MailOutlined /> <span> Your Email: </span> {userMeta.email}</>}
                />
            </List.Item>

            <List.Item>
                <List.Item.Meta
                title={<> <MailOutlined /> <span> Your Id: </span> {userMeta.uid}</>}
                />
            </List.Item>

        </List>
        </MetaWrapper>

    )
}

export default Meta
